import './styles/App.scss';
import { Route, Routes } from 'react-router-dom';


// Pages
import Home from './pages/Home';

function App() {
  return (

    <Routes>
        <Route path="/" exact={true} element={<Home/>}/>
    </Routes>
  );
}

export default App;
